import React from "react";
import Block from "./ActualBlock";

export default function DivBlock({ blocks }) {
  return (
    <div className="App">
      {blocks.map((block) => (
        <div className="border">
          <Block key={block.key} />
          {block.key}
        </div>
      ))}
    </div>
  );
}
